package devtests;

import java.net.*;
import java.io.*;
/**
 * @author jackpark
 * LinkGrammar parser is serving on port 9000
 */
public class LGSocketTest {
	private Socket s;
	private final String QUERY = 
			"text:The pandemic of obesity, type 2 diabetes mellitus (T2DM) and nonalcoholic fatty liver disease (NAFLD) has frequently been associated with dietary intake of saturated fats (1) and specifically with dietary palm oil (PO) (2).";
	//private final String QUERY = "text:this is a sentence to parse";
	//private final String QUERY = "text:Now is the time for all good men to come to the aid of their country.";
	private Object SYNCH = new Object();
	/**
	 * 
	 */
	public LGSocketTest() {
		try {
			System.out.println("starting");
			s = new Socket("localhost", 9000);
			System.out.println("X "+s);
			OutputStreamWriter osw = new OutputStreamWriter(s.getOutputStream(), "UTF-8");
			PrintWriter pw = new PrintWriter(osw, true);
			pw.println(QUERY);
			InputStream input = s.getInputStream();
			System.out.println("Z "+input);
			BufferedReader rd = new BufferedReader(new InputStreamReader(input));
			StringBuilder buf = new StringBuilder();
			System.out.println("ZZ "+rd.ready());
			synchronized(SYNCH) {
				while (!rd.ready()) {
					System.out.println("W");
					try {
						SYNCH.wait(1000);
					} catch (Exception e) {
						e.printStackTrace();
					}
				}
			}

			String line;
			while ((line = rd.readLine()) != null) {
				buf.append(line + '\n');
			}
			System.out.println("A "+buf.toString());
			s.close();
			
		} catch (Exception e) {
			e.printStackTrace();
		}
		System.exit(0);
	}

}
